             {DDIList.PrescriptionControlState, new DDIEntry{Id = 158, Name = "PrescriptionControlState", Description = " Defines and synchronise the actual state of the prescription system. The state is represented by the lowest significant 2 bits in the lowest significant byte of the process data value: Byte 1: bit 0-1: 00 = manual/off, 01 = auto/on, 10 = error indicator, 11 = undefined/not installed. bits 2-7: reserved set to 0. Byte 2-4: reserved set to 0.", Resolution = 1, Unit = "n.a."} },
