             {DDIList.ActualCondensedWorkState1_16, new DDIEntry{Id = 161, Name = "ActualCondensedWorkState1_16", Description = " Combination of the actual work states of individual sections or units (e.g. nozzles) number 1 to 16 into a single actual work state of their parent device element. The actual condensed work state contains the child element actual work states, in the driving direction from left to right, where the leftmost child element actual work state are the 2 lowest significant bits of the Process Data Value. Each child device elements actual work state is represented by 2 bits and defined as: 00 = disabled/off, 01 = enabled/on, 10 = error indicator, 11 = undefined/not installed. In total 16 child device element actual work states can be contained in one actual condensed work state of their parent device element. If less than 16 child device element actual work states are available, then the unused bits shall be set to value 11 (not installed). When the parent device element contains the Actual Condensed Work State DDE, then the device descriptor shall not contain the individual actual work state DDEs of the child device elements.", Resolution = 1, Unit = "n.a."} },
