             {DDIList.CondensedSectionOverrideState1_16, new DDIEntry{Id = 367, Name = "CondensedSectionOverrideState1_16", Description = " This DDE is used by the implement to communicate that a certain section is overridden and will not follow the section control commands. The value is a combination of the override states of individual sections number 1 to 16 into a single override state. The condensed section override state contains the child element override states, in the driving direction from left to right, where the leftmost child element override state are the 2 lowest significant bits of the Process Data Value. Each child device elements override state is represented by 2 bits and defined as: 00 = section is not overridden, 01 = section is overridden, 10 = reserved, 11 = undefined / not installed. In total 16 child device element override states can be contained in one condensed section override state. If less than 16 child device element override states are available, then the unused bits shall be set to value 11 (undefined / not installed). This DDE shall be placed in the same device element as the corresponding actual condensed work state.", Resolution = 1, Unit = "not defined"} },
